import './Standings.css';
import Table from './Table';

const Standings = ({ standings }) => {
  const result = [];
  result.push(standings.map(e => e.table));


  return (
    <section>
      {result.map(e => <Table e={e.table}/>)}
    </section>
  )
};

export default Standings;
